import React, { useContext, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { GeneralContext } from '../context/GeneralContext';
import { Menu, X } from 'lucide-react';

const Navbar = () => {
    const navigate = useNavigate();
    const usertype = localStorage.getItem('userType');
    const { logout } = useContext(GeneralContext);
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const NavLink = ({ to, children }) => (
        <p 
            onClick={() => {
                navigate(to);
                setIsMenuOpen(false);
            }}
            className="relative cursor-pointer text-gray-300 hover:text-white transition-colors duration-200 py-2 px-1
                      after:content-[''] after:absolute after:w-0 after:h-0.5 after:bg-white 
                      after:left-0 after:bottom-0 after:transition-all after:duration-300
                      hover:after:w-full"
        >
            {children}
        </p>
    );

    const renderNavContent = () => {
        if (!usertype) {
            return (
                <>
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/auth">Login</NavLink>
                </>
            );
        } else if (usertype === 'customer') {
            return (
                <>
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/bookings">Bookings</NavLink>
                    <p onClick={logout} className="cursor-pointer text-gray-300 hover:text-white transition-colors duration-200">Logout</p>
                </>
            );
        } else if (usertype === 'admin') {
            return (
                <>
                    <NavLink to="/admin">Home</NavLink>
                    <NavLink to="/all-users">Users</NavLink>
                    <NavLink to="/all-bookings">Bookings</NavLink>
                    <NavLink to="/all-flights">Flights</NavLink>
                    <p onClick={logout} className="cursor-pointer text-gray-300 hover:text-white transition-colors duration-200">Logout</p>
                </>
            );
        } else if (usertype === 'flight-operator') {
            return (
                <>
                    <NavLink to="/flight-admin">Home</NavLink>
                    <NavLink to="/flight-bookings">Bookings</NavLink>
                    <NavLink to="/flights">Flights</NavLink>
                    <NavLink to="/new-flight">Add Flight</NavLink>
                    <p onClick={logout} className="cursor-pointer text-gray-300 hover:text-white transition-colors duration-200">Logout</p>
                </>
            );
        }
        return null;
    };

    const getTitle = () => {
        if (!usertype) return 'SB Flights';
        if (usertype === 'admin') return 'SB Flights (Admin)';
        if (usertype === 'flight-operator') return 'SB Flights (Operator)';
        return 'SB Flights';
    };

    return (
        <nav className="fixed top-0 left-0 right-0 z-50 bg-gradient-to-r from-blue-900 to-blue-800 h-16 shadow-lg transition-all duration-300">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 h-full">
                <div className="flex justify-between items-center h-full">
                    <h3 className="text-xl font-semibold text-white tracking-wide">
                        {getTitle()}
                    </h3>

                    {/* Desktop Navigation */}
                    <div className="hidden md:flex space-x-8">
                        {renderNavContent()}
                    </div>

                    {/* Mobile Menu Button */}
                    <button
                        onClick={() => setIsMenuOpen(!isMenuOpen)}
                        className="md:hidden text-white hover:text-gray-300 transition-colors duration-200"
                    >
                        {isMenuOpen ? <X size={24} /> : <Menu size={24} />}
                    </button>
                </div>
            </div>

            {/* Mobile Navigation */}
            <div
                className={`md:hidden fixed top-16 left-0 right-0 bg-blue-900/95 backdrop-blur-sm transition-transform duration-300 ease-in-out ${
                    isMenuOpen ? 'transform translate-y-0' : 'transform -translate-y-full'
                }`}
            >
                <div className="px-4 pt-2 pb-4 space-y-2">
                    {renderNavContent()}
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
